import React from "react";
import axios from "axios";
import { useState } from "react";
import { useNavigate } from "react-router";
import { useParams } from "react-router";
import { useEffect } from "react";
import Main from "./main";
import './sample.css'

function Insertdata(props){
    return(
        <div> 
 <Main ad='Addcontest' page='Result'  home='/pro' votehere='/pro' card={<Data />}   />
        </div>
    )
}

export default Insertdata


function Data(props){

  let  m=useNavigate();
 
    const [pname, setpname] = useState('');
	const [Hours, setHours] = useState('')
	

	const psub = (req, res) => {
		var today = new Date();
		today.setMinutes(today.getMinutes() + 2 );
        const data = { description: pname,Time:today.getTime()};
        axios.post("http://localhost:8000/reg/posenter", data).then((res) => {
			if(res.data.message==="SUCCESS"){
                m('/pro')
			}
			else{
			
			}


        });
    };


    return(
        

<div class="section">
		<div class="container">
			<div class="row full-height justify-content-center">
				<div class="col-12 text-center align-self-center py-5">
					<div class="section pb-5 pt-5 pt-sm-2 text-center">

						<div class="card-3d-wrap mx-auto">
							<div class="card-3d-wrapper">
								<div class='card-front'>
									<div class="center-wrap">
										<div class="section text-center">
                                            <form >
											<h4 style={{color:'white'}} class="mb-4 pb-3">Position Details</h4>
											<div class="form-group">
												<input style={{marginBottom:'5px'}} onChange={(event)=>{setpname(event.target.value)}} type="text" name="logemail" class="form-style" placeholder="Position Name" id="logemail" autocomplete="off" required/>
												<i  class="input-icon uil uil-at"></i>
												<div style={{display:'flex'}}>
													<div>
													<input  onChange={(event)=>{setpname(event.target.value)}} type="text" name="logemail" class="form-style" placeholder="Date" id="logemail" autocomplete="off" required/>
													<i class="input-icon uil uil-at"></i>
													</div>
													<div>
													<input onChange={(event)=>{setpname(event.target.value)}} type="text" name="logemail" class="form-style" placeholder="Month" id="logemail" autocomplete="off" required/>
													<i class="input-icon uil uil-at"></i>
													</div>
													<div>
													<input onChange={(event)=>{setpname(event.target.value)}} type="text" name="logemail" class="form-style" placeholder="Year" id="logemail" autocomplete="off" required/>
													<i class="input-icon uil uil-at"></i>
													</div>
												</div>
												<div style={{textAlign:'center'}}>
													<div  style={{display:'flex',justifyContent:'center'}}> 
														<input placeholder="Hr" class='rcard' style={{margin:'10px',padding:'10px',fontSize:'15px',borderRadius:'10px',width:'50px'}} required></input>
														<div style={{margin:'10px',padding:'10px',fontSize:'20px',width:'10px',color:'white'}}>:</div>
														<input placeholder="Minutes" class='rcard' style={{margin:'10px',padding:'10px',fontSize:'15px',borderRadius:'10px',width:"50px"}} required></input>
														<div style={{margin:'10px',padding:'10px',fontSize:'20px',color:'white'}}>:</div>
														<input placeholder="Sec" class='rcard' style={{margin:'10px',padding:'10px',fontSize:'12x',borderRadius:'10px',width:"50px"}} required></input>
													</div>
													</div>
											</div>	
											
                                            
                                    
										<a onClick={psub} class="btn mt-4">Create</a>:
                                        
											
                            				<p class="mb-0 mt-4 text-center"><a href="" class="link">Forgot your password?</a></p>
                                            </form>
				      					</div>
			      					</div>
			      				</div>
                  </div>
                </div>
               </div>
             </div>
           </div>
         </div>
      

        </div>
    )
}
